import React, { Component } from 'react';
import ReactDOM from 'react-dom';


class Menu extends Component {

    render() {
        return (
            <div className='menubar'>
                <ul className='menu'>
                    <li>Home</li>
                    <li>FAQ</li>
                    <li>Locais</li>
                    <li>Categoriaa</li>
                </ul>
            </div>
        )





    };




}

export default Menu;
